import React from "react";
import { TopNav, NavLink }
 from "./Navbar";
import waterlogo from "../assets/water-logo.mp4";



const Navbar = () => {

    const menu = ["about", "education", "work", "skills", "projects", "contact"];
    var menuCount=0;
    function runOnClick() {
        document.getElementById(menu[2]).scrollIntoView({block: "end" });
        var checkTog = document.getElementById('my-drawer-2');
           if (checkTog.checked = true) {
            checkTog.checked=false;
           }
    }

return (

    <TopNav className="drawer lg:drawer-open lg:w-[100%]" > 

    <input id="my-drawer-2" type="checkbox" className="drawer-toggle"/> 

    <div className="drawer-content lg:hidden">
        {/* Page content here */}
        <label htmlFor="my-drawer-2" className="btn btn-primary drawer-button lg:hidden">Open drawer</label>
    </div>

    <div className="drawer-side">
        <label htmlFor="my-drawer-2" aria-label="close sidebar" className="drawer-overlay"></label> 
        <ul className="menu w-80 min-h-full bg-[#ffb3fffc] lg:w-[100%]">
        {/* Sidebar content here */}
        <video src= {waterlogo} autoPlay loop muted className="invisible lg:visible lg:p-[.5rem] lg:mb-2 lg:w-[100%]"/>

        <NavLink to="/about " onClick={runOnClick()}>
            About
        </NavLink>
        <NavLink to="/education" onClick={() => document.getElementById(menu[2]).scrollIntoView({ block: "end" })} activeStyle>
            Education
        </NavLink>
        <NavLink to="/workexperience" onClick={() => document.getElementById("work").scrollIntoView({ block: "end" })} activeStyle>
            Work Experience
        </NavLink>
        <NavLink to="/skills" onClick={() => document.getElementById("skills").scrollIntoView()} activeStyle>
            Skills
        </NavLink>
        <NavLink to="/projects&activities" onClick={() => document.getElementById("projects").scrollIntoView()} activeStyle>
            Projects and Activities
        </NavLink>
        <NavLink className ="lg:mb-36" to="/contact" onClick={() => document.getElementById("contact").scrollIntoView()} activeStyle>
            Contact
        </NavLink>

        </ul>
    </div>

    </TopNav>

